using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

using Oracle.ManagedDataAccess.Client;
using System;
using System.Data;
using System.IO;

namespace ModelsStore.DbConn.Utilities
{
    public class InsertarBlobs
    {

        public bool blob_images(string query, string connectionString)

        {
            try
            {

                //// Ruta al archivo BLOB en el servidor de archivos
                //string filePath = "ruta_al_archivo.blob"; // Reemplaza con la ruta adecuada
                var blobDataString = ("data:image/png;base64,");

                // Lee el contenido del archivo BLOB
                //byte[] blobData = File.ReadAllBytes(filePath);
                byte[] blob_newdata = Encoding.Default.GetBytes(blobDataString);

                using (OracleConnection connection = new OracleConnection(connectionString))
                {
                    connection.Open();

                    // Crea un comando para la inserción
                    using (OracleCommand cmd = connection.CreateCommand())
                    {
                        cmd.CommandType = CommandType.Text;
                       
                        cmd.CommandText = "INSERT INTO PRUEBASIMAGEN (UUID,IMAGEN) VALUES (DEFAULT,:blobParam)";
                        // Agrega el parámetro BLOB al comando
                       
                        OracleParameter blobParam = new OracleParameter("blobParam", OracleDbType.Blob);
                        
                        blobParam.Value = blob_newdata;
                       
                        cmd.Parameters.Add(blobParam);
                        // Ejecuta la inserción
                       
                        cmd.ExecuteNonQuery();
                    }
                }

                Console.WriteLine("BLOB insertado correctamente en la base de datos Oracle.");

                return true;
            }
            catch (Exception ex)
            {
                return false;
            }


        }

        public bool insertBlobs(string query, string blob,string connectionString)
        {
            try
            {

                var result = query.Contains("data:img");

                if (result == true)
                {
                    query = query.Replace("'data:img'", ":blobParam");
                }

                var blobDataString = blob;

                byte[] blob_newdata = Encoding.Default.GetBytes(blobDataString);

                using (OracleConnection connection = new OracleConnection(connectionString))
                {
                    connection.Open();

                    // Crea un comando para la inserción
                    using (OracleCommand cmd = connection.CreateCommand())
                    {
                        cmd.CommandType = CommandType.Text;

                        cmd.CommandText = query;
                        
                        // Agrega el parámetro BLOB al comando
                        
                        OracleParameter blobParam = new OracleParameter("blobParam", OracleDbType.Blob);
                        
                        blobParam.Value = blob_newdata;
                        
                        cmd.Parameters.Add(blobParam);
                        
                        // Ejecuta la inserción
                        
                        cmd.ExecuteNonQuery();
                        
                        Console.WriteLine(cmd.CommandText);
                        
                        connection.Close();
                    }
                }

                return true;

            } catch (Exception ex)
            {


                Console.WriteLine(query);

                Console.WriteLine(ex.ToString());

                return false;
            }



        }

    }
}
